import '../App.css';
import { useState } from 'react';
import createUser from '../fauna/createUser';

function Registration() {
  const [alertMessage, setAlertMessage] = useState({
    type: '',
    message: ''
  });
  const [formState, updateFormState] = useState({
    fname: '',
    mname: '',
    lname: '',
    gender: '',
    dob: '',
    email: '',
    phone: '',
    address: '',
    bank_name: '',
    account_name: '',
    account_number: '',
  });


  const updateForm = e => {
    const { value, name } = e.target;
    updateFormState({
      ...formState,
      [name]: value
    });
  };

  const saveInfo = async () => {

    if (!formState.fname) {
      setAlertMessage({
        type: 'danger',
        message: 'Please fill all fields'
      });
      return;
    }


    const data = {
      ...formState,
    }

    const result = await createUser(data);

    if (result.ts) {
      setAlertMessage({ type: 'success', message: 'Registration successful' });
    } else {
      setAlertMessage({ type: 'danger', message: 'Registration failed' });
    }

  }


  setTimeout(() => {
    clearAlertMessage();
  }, 20000);

  const clearAlertMessage = () => {
    setAlertMessage({
      type: '',
      message: ''
    });
  }


  // console.log(formState);

  return (
    <div class="container" style={{marginTop: '100px', marginBottom: '100px'}}>

      <h1 class="well text-center">Registration Form</h1>

      <div class="col-lg-10 well card mx-auto">
        <div class="row card-body">

          <input type="hidden" name="reference" value="372789" />
          {alertMessage.message && (
            <div class={`alert alert-${alertMessage.type}`} role="alert">
                {alertMessage.message}
            </div>
            )}

          <div class="col-sm-12">
            <div class="row">
              <div class="col-sm-4 form-group">
                <label>First Name</label>
                <input type="text" name="fname" onChange={updateForm} required="required" placeholder="Enter First Name Here.." class="form-control" />
              </div>
              <div class="col-sm-4 form-group">
                <label>Middle Name</label>
                <input type="text" name="mname" onChange={updateForm} placeholder="Enter Middle Name Here.." class="form-control" />
              </div>
              <div class="col-sm-4 form-group">
                <label>Last Name</label>
                <input type="text" name="lname" onChange={updateForm} required="required" placeholder="Enter Last Name Here.." class="form-control" />
              </div>
            </div>

            <div class="row">
              <div class="col-sm-6 form-group">
                <label>Gender</label>
                <select class="form-control" onChange={updateForm} name="gender" required="required" >
                  <option value="">Choose</option>
                  <option> Male </option>
                  <option> Female </option>
                </select>
              </div>
              <div class="col-sm-6 form-group">
                <label>Date of Birth</label>
                <input type="text" name="dob" onChange={updateForm} placeholder="Enter Date of Birth Here.." class="form-control" required />
              </div>
            </div>

            <div class="row">
              <div class="col-sm-6 form-group">
                <label>Email Address</label>
                <input type="email" name="email" onChange={updateForm} placeholder="Enter Email Address Here.." class="form-control" required />
              </div>
              <div class="col-sm-6 form-group">
                <label>Whatsapp Number </label>
                <input type="Number" name="phone" onChange={updateForm} placeholder="Enter Whatsapp number Here.." class="form-control" required />
              </div>
            </div>

            <div class="form-group">
              <label>Contact Address</label>
              <textarea onChange={updateForm} placeholder="Enter Contact Address Here.." rows="3" class="form-control" name="address" required></textarea>
            </div>


            <h3 class=" ">Bank Details</h3>

            <div class="form-group">
              <label>Bank Name</label>
              <input type="text" onChange={updateForm} placeholder="Enter Bank Name Here.." class="form-control" name="bank_name" required />
            </div>
            <div class="form-group">
              <label>Account Name</label>
              <input type="text" onChange={updateForm} placeholder="Enter Account Name Here.." class="form-control" name="account_name" required />
            </div>
            <div class="form-group">
              <label>Account Number</label>
              <input type="text" onChange={updateForm} placeholder="Enter Account Number Here.." class="form-control" name="account_number" required />
            </div>
            <button  onClick={saveInfo} name="register-form" class="btn btn-md btn-success">Submit</button>


          </div>
          <p>&nbsp;</p>
          <p style={{margin: "0px 15px 10px"}}>Kindly confirm that the phone number you provided is a whatsapp number. You will be added to a whatsapp group with one week of your registration.</p>


        </div>
      </div>

    </div>
  );
}

export default Registration;
